INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('3046','1083','22','347','6/8/12 12:00:00 AM','7','Email','Student: I got your voicemail message, and saw that you wanted to know if I had completed my hours. On Monday June 4, 2012 I completed 25 hours at the Resurrection Project Image Task Force. Last time I spoke to you, I had completed 18 hours, and needed 7 more hours. Therefore, on Saturday after the clean and green event, I was given the opportunity to write an article of the event, and take pictures of everything that occurred for the Pilsen Portal website. Therefore, I was given 2 more hours for that, which made my total hours at 20. Moreover, since I still needed 5 more hours, I asked the site manager, Valerie Paurus Ota, if she could give me an opportunity to complete my hours that Monday, before Tuesday (where my the yellow sheet with completed hour was due with our final). She allowed me to complete the remaining 5 hours at the Jose Clemente Orozco Community Academy school, located in Pilsen. There I helped Valerie dig trenches in the school garden, and secure the irrigation drip ','Fall 2012',null,null,null);
