INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('2805','690','6','246','6/1/12 12:00:00 AM','4','Email','have 17 Hours of service and I will be going on Thursday and one day during finals week to finish it off. As for my experiences, I have had pretty positive experiences, the youth seem very nice although none have asked me for help with their PLATO program. The people who run the organization are also very nice and accomodating. So far I have done mostly marketing efforts (such as putting flyers into envelopes and addressing them to the people on their mailing list). I would reccommend this site based on how nice the people are all around.','Fall 2012',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('2804','1083','22','347','6/1/12 12:00:00 AM','9.5','Telephone','So far I was lagging behind with some hours, but I have been attending more events so I should be fine. Today I went to an event that the organization held, and that was 4 hours. Moreover, things have been pretty slow with the site, because of the big event that they had today, and some funding issues. Nevertheless, our site coordinators are always able to find something for us to do. This Saturday we are actually going to do the "Clean and Green" II around Pilsen, from 8am to 1pm so that should get me extra hours. At this point, I''m trying to be as flexible as possible, given that I have a job and still need hours to complete before they are due. Also, this past Friday, we learned how to properly mulch a tree, and did some tree care along an elementary school in Pilsen. This site has very diverse activities for us, from planting, to cleaning and planning it''s all very interactive. Moreover, throughout the whole process at the site, I have realized that there is more to non-profit orga','Fall 2012',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('2803','1083','22','345','6/1/12 12:00:00 AM','10','Email','I completed my hours, I have 25.5 hours. I would recommend this site to others. I worked with a great group of people that really care about the Pilsen community. I think it was a great impact volunteering  to clean up the Pilsen area.','Fall 2012',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('2802','690','22','251','6/1/12 12:00:00 AM','0','Email','My service has been good. I''m at 21 hours and will be doing 5 more on Monday. The most positive experience has been my students telling me they weren''t able to understand something all throughout school but after a couple hours with my one on one tutoring they were able to get a good grasp on things. My site, Central Sates SER, really tries to put these young men and women on a path to success. It has been a privilege to work with them. I''d recommend using this site in the future. ','Fall 2012',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('2801','690','6','573','6/1/12 12:00:00 AM','5','Email','I have completed all my hours. None were with my assignment service site. They were extremely unorganized and not communicative. I would not recommend them again. ','Fall 2012',null,null,null);
