INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('2798','636','43','192','6/1/12 12:00:00 AM','8','Telephone','completed all hours','Fall 2012',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('2797','690','6','250','6/1/12 12:00:00 AM','6','Email','I have acquired a total of 26 hours. The service went well; I definitely recommend Central States Ser to anyone who might want to become a teacher or a social worker. The students are determined to pass the GED appreciate the tutoring. Some students find it easier to learn while working with a tutor since it is more one on one. I noticed that tutoring is extremely helpful because students feel more comfortable to ask questions. The students are at-risk-youth and have a lot on their plate. In my experience I would take a quick 10 minute break in between the tutoring session to learn more about the students. I found this to be effective because a lot of the students simply need someone to express their feelings about whatever they may be dealing with outside of the school setting.  My last day of service was May 30th and it was hard saying goodbye. They made good-bye cards and let me know how much they appreciate our service! I even got a quick brush-up on my math skills since I spent mo','Fall 2012',null,null,null);
